import React, { useState } from 'react';

const DynamicInterface = () => {
  const [users, setUsers] = useState([
    { id: 1, name: 'John Doe', email: 'john@example.com', showDetails: false },
    { id: 2, name: 'Jane Smith', email: 'jane@example.com', showDetails: false }
  ]);

  const [newUser, setNewUser] = useState('');

  const addUser = () => {
    if (newUser.trim() === '') return;

    const newId = users.length + 1;
    setUsers([...users, { id: newId, name: newUser, email: `${newUser}@example.com`, showDetails: false }]);
    setNewUser('');
  };

  const toggleDetails = (id) => {
    setUsers(users.map(user => 
      user.id === id ? { ...user, showDetails: !user.showDetails } : user
    ));
  };

  return (
    <div className="p-4 max-w-md mx-auto">
      <h1 className="text-2xl font-bold mb-4">Dynamic User List</h1>
      
      <div className="mb-4">
        <input
          className="border p-2 mr-2"
          type="text"
          value={newUser}
          onChange={(e) => setNewUser(e.target.value)}
          placeholder="Enter user name"
        />
        <button className="bg-blue-500 text-white p-2 rounded" onClick={addUser}>Add User</button>
      </div>

      {users.map(user => (
        <div key={user.id} className="mb-2 p-2 border rounded">
          <div className="flex justify-between items-center">
            <span className="font-medium">{user.name}</span>
            <button className="text-sm text-blue-600" onClick={() => toggleDetails(user.id)}>
              {user.showDetails ? 'Hide Details' : 'Show Details'}
            </button>
          </div>
          {user.showDetails && <div className="text-gray-600 mt-2">Email: {user.email}</div>}
        </div>
      ))}
    </div>
  );
};

export default DynamicInterface;
